''' Plot '''
no_it = 50
def plot(name, MSE_min, MSE_max, p1, p2, p3, p4, p5, p6, p7):
    fig = plt.figure(figsize=(3.8,3.0))
    fig.subplots_adjust(left=0.15, right=0.965, bottom=0.12, top=0.97)
    plt.xlabel("Iterations", fontsize=12, labelpad=1) #fontsize=8
    plt.ylabel("MSE", fontsize=12, labelpad=2) #fontsize=8, labelpad=-1
    plt.yticks(fontsize=8) #fontsize=6
    plt.xticks(fontsize=8) #fontsize=6
    
    colours = ['#0000ff','#00ff00','#ff0000','#00ffff','#ff00ff','#ffff00','#00007f']#,'#007f00']

    plt.plot(iterations[:no_it], p1[:no_it], linestyle='-', linewidth=1.2, marker='o', label='Exp',                    c=colours[0], markersize=1)
    plt.plot(iterations[:no_it], p2[:no_it], linestyle='-', linewidth=1.2, marker='o', label='Random',                 c=colours[1], markersize=1)
    plt.plot(iterations[:no_it], p3[:no_it], linestyle='-', linewidth=1.2, marker='o', label='K-means, exp',           c=colours[2], markersize=1)
    plt.plot(iterations[:no_it], p4[:no_it], linestyle='-', linewidth=1.2, marker='o', label='K-means, random',        c=colours[3], markersize=1)
    plt.plot(iterations[:no_it], p5[:no_it], linestyle='-', linewidth=1.2, marker='o', label='Exp, least squares',     c=colours[4], markersize=1)
    plt.plot(iterations[:no_it], p6[:no_it], linestyle='-', linewidth=1.2, marker='o', label='Random, least squares',  c=colours[5], markersize=1)
    plt.plot(iterations[:no_it], p7[:no_it], linestyle='-', linewidth=1.2, marker='o', label='K-means, least squares', c=colours[6], markersize=1)
    
    plt.xlim(0,no_it+1)
    plt.ylim(MSE_min,MSE_max)
    
    plt.legend(loc='upper right',fontsize=8)
    plt.savefig("./%s.png" % name, dpi=600)
    
    
